// Parse FantasyCalc â€” separates risers/fallers/picks + formats Supabase rows
// v3: FantasyCalc API feeds directly into this node
const players = $input.all().map(i => i.json);

// players already set from $input.all()

const today = new Date().toISOString().split('T')[0];

const formatted = players.filter(p => p).map(p => {
  const pl = p.player || {};
  const pk = p.pick || null;
  const isPick = !!pk;
  const name = isPick
    ? `${pk.season || ''} Pick ${pk.round || ''}.${String(pk.order || '').padStart(2, '0')}`
    : (pl.name || `${pl.firstName || ''} ${pl.lastName || ''}`.trim() || 'Unknown');
  return {
    player_name: name,
    name: name,
    position: isPick ? 'PICK' : (pl.position || '??'),
    team: isPick ? null : (pl.maybeTeam || pl.team || 'FA'),
    sleeperId: pl.sleeperId || null,
    age: pl.maybeAge ? Math.round(pl.maybeAge * 10) / 10 : null,
    dynasty_value: p.value || 0,
    value: p.value || 0,
    overall_rank: p.overallRank || 999,
    overallRank: p.overallRank || 999,
    positionRank: p.positionRank || 999,
    trend_30day: p.overallTrend || p.trend30Day || 0,
    trend30Day: p.overallTrend || p.trend30Day || 0,
    is_pick: isPick,
    is_rookie: pl.rookie || false,
    tier: p.maybeTier || null,
    tradeFrequency: p.maybeTradeFrequency || 0,
  };
});

formatted.sort((a, b) => b.dynasty_value - a.dynasty_value);

// Subsets for the AI prompt
const risers = formatted.filter(p => p.dynasty_value >= 500 && p.trend_30day > 0)
  .sort((a, b) => b.trend_30day - a.trend_30day).slice(0, 15);
const fallers = formatted.filter(p => p.dynasty_value >= 500 && p.trend_30day < 0)
  .sort((a, b) => a.trend_30day - b.trend_30day).slice(0, 15);
const picks2026 = formatted.filter(p => p.name.includes('2026') && p.position === 'PICK')
  .sort((a, b) => a.overallRank - b.overallRank);
const youngPlayers = formatted.filter(p => p.position !== 'PICK' && p.age && p.age <= 23)
  .sort((a, b) => a.overallRank - b.overallRank).slice(0, 20);

// Format rows for Supabase fantasycalc_daily table
const fc_daily_rows = formatted.map(p => ({
  snapshot_date: today,
  player_name: p.player_name,
  position: p.position,
  team: p.team,
  dynasty_value: p.dynasty_value,
  trend_30day: p.trend_30day,
  overall_rank: p.overall_rank,
  is_rookie: p.is_rookie,
  is_pick: p.is_pick,
}));

return [{ json: {
  fc_values: formatted,
  fc_count: formatted.length,
  fc_daily_rows: fc_daily_rows,
  fantasycalc: {
    top50: formatted.slice(0, 50),
    allPlayers: formatted,
    risers, fallers, picks2026, youngPlayers,
    totalPlayers: formatted.length,
    fetchedAt: new Date().toISOString(),
  }
}}];

if ($input.all().length === 0) {
  return [{ json: { cacheMissing: true, message: 'Player cache not found.', playerLookup: {} } }];
}
const row = $input.first().json;
const value = row.value;
if (typeof value !== 'string' || value.length < 10) {
  return [{ json: { cacheMissing: true, message: 'Cache row value is missing or too small.', playerLookup: {} } }];
}
let lookup;
try { lookup = JSON.parse(value); } catch(e) {
  return [{ json: { cacheMissing: true, message: 'Cache parse error: ' + e.message, playerLookup: {} } }];
}
if (!lookup || typeof lookup !== 'object' || Object.keys(lookup).length < 1000) {
  return [{ json: { cacheMissing: true, message: 'Parsed cache looks too small.', playerLookup: {} } }];
}
return [{ json: { cache_ready: true, player_count: Object.keys(lookup).length, playerLookup: lookup } }];

// Enrich trending adds/drops with player names, position, team from cache
// v3.1: outputs both player_name AND name/position/team for downstream compat
const allInputs = $input.all().map(i => i.json);

let playerCache = {};
let addsRaw = [];
let dropsRaw = [];

for (const item of allInputs) {
  if (item.player_cache) {
    playerCache = item.player_cache;
  } else if (item.adds !== undefined || Array.isArray(item) && item[0]?.player_id) {
    addsRaw = Array.isArray(item) ? item : (item.adds || []);
  } else if (item.drops !== undefined) {
    dropsRaw = Array.isArray(item) ? item : (item.drops || []);
  }
}

// Fallback: try direct node references
if (Object.keys(playerCache).length === 0) {
  try { playerCache = $('Parse Player Cache').first().json.player_cache || {}; } catch(e) {}
  if (Object.keys(playerCache).length === 0) {
    try { playerCache = $('Parse Player Cache').first().json.playerLookup || {}; } catch(e) {}
  }
}
if (addsRaw.length === 0) {
  try { addsRaw = $('Sleeper Trending Adds').all().map(i => i.json); } catch(e) {}
}
if (dropsRaw.length === 0) {
  try { dropsRaw = $('Sleeper Trending Drops').all().map(i => i.json); } catch(e) {}
}

// Build FC sleeperId lookup as secondary name source
let fcLookup = {};
try {
  const fcData = $('Parse FantasyCalc').first().json;
  const allPlayers = fcData.fc_values || fcData.fantasycalc?.allPlayers || [];
  for (const p of allPlayers) {
    if (p.sleeperId) {
      fcLookup[String(p.sleeperId)] = {
        name: p.player_name || p.name,
        position: p.position,
        team: p.team
      };
    }
  }
} catch(e) {}

function lookup(sleeperId) {
  const id = String(sleeperId);
  const cached = playerCache[id];
  let name = null, position = null, team = null;

  if (cached && typeof cached === 'object') {
    const fn = cached.first_name || cached.fn || '';
    const ln = cached.last_name || cached.ln || '';
    name = (fn + ' ' + ln).trim() || null;
    position = cached.position || cached.pos || cached.p || null;
    team = cached.team || cached.t || null;
  } else if (typeof cached === 'string' && cached) {
    name = cached;
  }

  if (!name && fcLookup[id]) {
    name = fcLookup[id].name;
    position = position || fcLookup[id].position;
    team = team || fcLookup[id].team;
  }

  if (!name && cached && typeof cached === 'object') {
    name = cached.n || null;
    position = position || cached.p || null;
    team = team || cached.t || null;
  }

  return {
    name: name || `Unknown (${id})`,
    position: position || '-',
    team: team || '-'
  };
}

const trendingAdds = (addsRaw || []).slice(0, 10).map(p => {
  const info = lookup(p.player_id);
  return {
    player_id: p.player_id,
    player_name: info.name,
    name: info.name,
    position: info.position,
    team: info.team,
    add_count: p.add_count || p.count || 0,
    rank_adds: p.rank_adds || null,
  };
});

const trendingDrops = (dropsRaw || []).slice(0, 10).map(p => {
  const info = lookup(p.player_id);
  return {
    player_id: p.player_id,
    player_name: info.name,
    name: info.name,
    position: info.position,
    team: info.team,
    drop_count: p.drop_count || p.count || 0,
    rank_drops: p.rank_drops || null,
  };
});

const today_sig = new Date().toISOString().split('T')[0];
const signal_rows = trendingAdds.map(p => ({
  signal_date: today_sig,
  player_name: p.player_name,
  position: p.position || null,
  team: p.team || null,
  add_count: p.add_count || 0,
  drop_count: trendingDrops.find(d => d.player_id === p.player_id)?.drop_count || 0,
  rank_adds: p.rank_adds || null,
  rank_drops: p.rank_drops || null,
}));

return [{ json: { trending_adds: trendingAdds, trending_drops: trendingDrops, signal_rows } }];

// Collect all data from parallel branches and return to Main
let fcData = {};
try { fcData = $('Parse FantasyCalc').first().json; } catch(e) {}

let trendingData = {};
try { trendingData = $('Enrich Trending Data').first().json; } catch(e) {}

let fcDiffs = [];
try { fcDiffs = $('Read FC Diffs').all().map(i => i.json).filter(r => r && r.player_name); } catch(e) {}

let signalStreaks = [];
try { signalStreaks = $('Read Signal Streaks').all().map(i => i.json).filter(r => r && r.player_name); } catch(e) {}

let mentionCounts = [];
try { mentionCounts = $('Read Mention Counts').all().map(i => i.json).filter(r => r && r.player_name); } catch(e) {}

let prospectProfiles = [];
try { prospectProfiles = $('Read Prospect Profiles').all().map(i => i.json).filter(r => r && r.player_name); } catch(e) {}

let whitelist = [];
try { whitelist = $('Read Prospect Whitelist').all().map(i => i.json).filter(r => r && r.player_name); } catch(e) {}

return [{ json: {
  fcData,
  trendingData,
  fcDiffs,
  signalStreaks,
  mentionCounts,
  prospectProfiles,
  whitelist
}}];
